import React, { Component } from 'react'
import { Box, IconButton, Slider } from '@mui/material'
import Icon from '../../../IconLibrary/Icon'
class VideoPlayer extends Component {
    constructor(props) {
        super(props)
        this.state = {
            videoUrl: 'https://www.w3schools.com/html/mov_bbb.mp4',
            isPlaying: true,
            volume: 50,
            playbackRate: 1,
            currentTime: 0,
        }
    }

    render() {
        const { isPlaying, volume, playbackRate, currentTime, ...state } =
            this.props
        return (
            <Box>
                {/*  Video Player  */}
                <video autoPlay>
                    <source src={this.state.videoUrl} type="video/mp4" />
                </video>

                {/* Controls */}
                <Box>
                    {/*Play/Pause*/}
                    <IconButton>
                        {isPlaying ? (
                            <Icon icon={'play'} />
                        ) : (
                            <Icon icon={'pause'} />
                        )}
                    </IconButton>
                    {/* Forward and backward */}
                    <IconButton>
                        <Icon icon={'double_forward'} />
                    </IconButton>
                    <IconButton>
                        <Icon icon={'double_backward'} />
                    </IconButton>
                    {/* Volume */}
                    {volume === 0 ? (
                        <IconButton>
                            <Icon icon={'mute'} />
                        </IconButton>
                    ) : (
                        <IconButton>
                            <Icon icon={'mute'} />
                        </IconButton>
                    )}
                </Box>
            </Box>
        )
    }
}

export default VideoPlayer
